    void solve(vector<vector<char>>& board) {
        if (board.empty() || board.at(0).empty())
            return;
        int row(board.size()), column(board.at(0).size());
        unordered_set<int> cache;
        int index(-1);
        for (auto i = 0; i < row; ++i)
        {
            if (board.at(i).at(0) == 'O')
                flip(board, i, 0, row, column, cache);
            if (board.at(i).at(column - 1) == 'O')
                flip(board, i, column - 1, row, column, cache);
        }
        for (int j = 1; j < column - 1; ++j)
        {
            if (board.at(0).at(j) == 'O')
                flip(board, 0, j, row, column, cache);
            if (board.at(row - 1).at(j) == 'O')
                flip(board, row - 1, j, row, column, cache);
        }

        for (auto i = 0; i < row; ++i)
        {
            for (auto j = 0; j < column; ++j)
            {
                if (board.at(i).at(j) == '*')
                    board.at(i).at(j) = 'O';
                else
                    board.at(i).at(j) = 'X';
            }
        }
    }

